import React, {useEffect} from 'react';
import Choice from "./Choice/Choice";

function MultipleChoice(props) {

    useEffect(() => {
        return () => {
            console.log("Multiple Choice here");
            console.log(props.question);
            console.log(props.question.options);
        };
    }, [props.question]);

    return (
        <div>
            {props.question.options && props.question.options.length > 0 && props.question.options.map((option,index) => (
                <Choice  key={props.question.id} value={props.question.options[index]+" "+(index+1)} name={"id"}/>
            ))}
        </div>
    );
}

export default MultipleChoice;
